INSERT INTO `fs_fcurso` VALUES (1,'Automação Industrial','Prof. Rosirlei Clarete Batista Pavão','','O Tecnólogo em Eletrônica – Modalidade Automação Industrial, Atua nas áreas de Manufatura, Manutenção e Integração de Sistemas Automatizados.'),(2,'Manutenção Industrial','Prof. Arnando Gonçalves','','O Tecnólogo em Manutenção Industrial planeja, mantêm e inspeciona sistemas elétricos e mecânicos industriais.'),(3,'Gestão Empresarial','Prof. José Vicente Dias Mascarenhas','','O Tecnólogo em Gestão Empresarial (Processos Gerenciais) elabora e implementa planos de negócios, utilizando métodos e técnicas de gestão na formação e organização empresarial especificamente nos processos de comercialização, suprimento, armazenamento, movimentação de materiais e no gerenciamento de recursos financeiros e humanos'),(4,'Gestão de TI','Prof. Oswaldo D\'Estefano Rosica','','O Tecnólogo em Gestão da Tecnologia da Informação atua num segmento da área de informática que abrange a administração dos recursos de infra-estrutura física e lógica dos ambientes informatizados.'),(5,'Produção Fonográfica','Prof. Luís Antonio Galhego Fernandes','','O Tecnólogo em Produção Fonográfica atua em todas as etapas do processo de produção: pré-produção, gravação, edição, mixagem e masterização, operação de som, divulgação e distribuição do produto final.');
